import Playzinho from "../../Assets/Playzinho.png"
import CapaJogo from "../../Assets/The Witcher.jpg"

import { FlexContainer } from "./styles.js"

const Game = (name) => {
    return(
        <FlexContainer>
            <img id="CapaJogo" src={CapaJogo}></img>
            <p>
                <img src={Playzinho}></img>
                {name}
            </p>
        </FlexContainer>
    )
}

export default Game
